    def reset_board(self):
        self.board = [[0 for _ in range(9)] for _ in range(9)]
        self.set_board_from_current_state()
    
    def keyboardEventReceived(self, event):
        if event.event_type == 'down' and self.selected_button:
            if re.match("^\\d+$",event.name):
                print(event.name)
                self.selected_button.setText(event.name)
                self.change_board_cell(event.name)
                keyboard.unhook(self.hook)
                self.selected_button.setStyleSheet("")
                self.selected_button = None

    def change_board_cell(self,num):
        print(self.selected_button.objectName())
        x,y = [int(i) for i in self.selected_button.objectName().split("_")[-1]]
        self.board[x][y] = int(num)
        self.print_board()
        self.set_board_from_current_state()
        
    def set_board_from_current_state(self):
        for i in range(9):
            for j in range(9):
                getattr(self,f"square_{i}{j}").setText(str(self.board[i][j]))
        
    def print_board(self):
        for i in range(9):
            for j in range(9):
                print(self.board[i][j],end="")
            print("")
            
    def solve(self):
        result: SolverState = self.solver.solve(self.board)
        self.set_board_from_current_state()
        self.time_label.setText(f"Time: {result.time}")
        self.result_label.setText(f"Result: "+"Solved!" if result.state else "Couldn't Solve!")
        self.print_board()
        
    def printValue(self,attribute_id):
        print(attribute_id)
        if self.selected_button:
            self.selected_button.setStyleSheet("")
            self.selected_button = None
        self.selected_button = getattr(self, attribute_id)
        self.selected_button.setStyleSheet("background-color : grey")
        self.hook = keyboard.on_press(self.keyboardEventReceived)
        


